  maintained by AMS Marketing Services, is designed to provide members of the public
  with convenient access to information about U.S. farmers market locations, directions,
  operating times, product offerings, and accepted forms of payment. Market information
  included in the Directory is voluntary and self-reported to AMS by market managers,
  representatives from State farmers market agencies and associations, and other key
  market personnel.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
